(function(){
    var protocol = stm_document;
    var author = null;
	var authorAssocs = protocol.assocs["lecm-document:author-assoc"];
    if (authorAssocs && authorAssocs.length == 1) {
      author = authorAssocs[0];

      var notificationText = "Проект документа ";
      notificationText += documentScript.wrapperDocumentLink(protocol, "{lecm-eds-document:document-type-assoc/cm:name} №{~REGNUM|Не присвоено}");
      notificationText += " направлен вам на доработку";
	  notifications.sendNotification([author.nodeRef.toString()], notificationText, protocol);
    }

})();

/* направить на регистрацию */
(function(){
    var i,
        protocol = stm_document,
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRARS", protocol), /* получение списка регистраторов по документу */
        registrarsCount = registrars.length;

    /* раздаем права регистраторам */
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(protocol, registrars[i], "DA_REGISTRAR_DYN", task);
    }

    /* рассылаем уведомление */
    var notificationText = "Документ ";
    notificationText += documentScript.wrapperDocumentLink(protocol, "{lecm-eds-document:document-type-assoc/cm:name}, проект №{~REGNUM|Не присвоено}");
    notificationText += " поступил на регистрацию";
	notifications.sendNotification(registrars, notificationText, protocol);
})();

(function(){
    var protocol = stm_document;
  if (orgstructure.isCurrentEmployeeHasBusinessRole("ERRANDS_INITIATOR")) {
      var auto = protocol.properties["lecm-protocol:errands-autocreation"];
      if (auto) {
          var tableAssocs = protocol.assocs["lecm-protocol-ts:points-assoc"];
          if (tableAssocs!==null && tableAssocs.length > 0){
              var table = tableAssocs[0];
              var  pointAssocs = table.childAssocs["cm:contains"];
              if (pointAssocs!==null && pointAssocs.length > 0 ){
                  /* формируем поручения */
                  protocolService.formErrands(protocol);
              }
          }

      }
  }
})();

(function(){
    var protocol = stm_document;
    var auto = protocol.properties["lecm-protocol:errands-autocreation"];
    if (!auto) {
        var tableAssocs = protocol.assocs["lecm-protocol-ts:points-assoc"];
        if (tableAssocs!==null && tableAssocs.length > 0){
            var table = tableAssocs[0];
            var  pointAssocs = table.childAssocs["cm:contains"];
			if (pointAssocs){
				var length = pointAssocs.length;
				for (var i = 0; i < length; i++ ){
					var pointExecutorAssoc = pointAssocs[i].assocs["lecm-protocol-ts:executor-assoc"];
					if (pointExecutorAssoc && pointExecutorAssoc.length > 0){
						var pointExecutor = pointExecutorAssoc[0];
						statemachine.grandDynamicRoleForEmployee(protocol, pointExecutor, "PROTOCOL_POINT_EXECUTOR", task);

						var pointNumber = pointAssocs[i].properties["lecm-document:indexTableRow"];

						var notificationText = "Вы назначены исполнителем по пункту " + pointNumber + " протокола " ;
						notificationText += documentScript.wrapperDocumentLink(protocol, "{lecm-document:present-string}");
						notifications.sendNotification([pointExecutor.nodeRef.toString()], notificationText, protocol);
					}
				}
			}
        }
    }
})();
